#include<bits/stdc++.h>
using namespace std;

//TLE solution
class Solution1 {
public:
    
    bool isSubSeq(string s,string seq){
        int i=0,j=0;
        int n=s.length();
        int m=seq.length();
        while(i<n && j<m){
            if(s[i]==seq[j]){
                i++;
                j++;
            }
            else{
                i++;
            }
        }
        return (j==m);
    }
    
    int numMatchingSubseq(string s, vector<string>& words) {
        int n=words.size();
        int count=0;
        for(int i=0;i<n;i++){
            if(isSubSeq(s,words[i]))
                count++;
        }
        return count;
    }
};

class Solution {
public:

int numMatchingSubseq (string S, vector<string>& words) {
    vector<vector<int>> store (26);
    for (int i = 0; i < S.size (); ++i) store[S[i] - 'a'].push_back (i);
    int res = 0;

    for (const auto& word : words) {
        int x = -1;
        bool found = true;

        for (char c : word) {
            auto it = upper_bound (store[c - 'a'].begin (), store[c - 'a'].end (), x);
            if (it == store[c - 'a'].end ()) found = false;
            else x = *it;
        }

        if (found) res++;
    }

    return res;
}
};

